import React from "react";

const ModelList = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.items.map((model, i) => {
          return (
            <div key={i}>
              <div className="col-md-3">{model.Model_Name}</div>
            </div>
          );
        })}
      </div>
    </div>
  );
};
export default ModelList;
